import React, {Fragment, useState} from 'react'
import api from '../api';

const Register = () => {

  const [formData, setFormData] = useState({
    Fname: '',
    email: '',
    password: '',
    password2: ''
  });

  const {name, email, password, password2} = formData;

  const onChange = (e) =>  setFormData({ ...formData, [e.target.name] : e.target.value })

  const onSubmit = async () => {
    if(password !== password2)
    {
      return alert("Password do not match");
    }
    else
    {
      const newUser = {
        name,
        email,
        password
      };

      try
      {
          const config = {
           headers: {
                'Content-Type': 'application/json' 
            }  
          }
          const body = JSON.stringify(newUser);
          const res = await api.post('/user', body, config);
          console.log("Following data has been saved ", res.data);

      }
      catch(err)
      {
        console.log(err.response.data);
      }
    }

  }

  return (
      <Fragment>
      <div className='container mt-5 App-header'>
      <h2 className=''> Register as a Doctor </h2>
        <form className='form' onSubmit={e => onSubmit(e)}>
           <div className='form-group'>
             <label> Name</label> 
              <input 
                className='form-control' 
                type="text" 
                name='name'
                value = {name}
                placeholder='Name'
                onChange={(e)=> onChange(e)} 
              />
            </div>
            <div className='form-group'>
              <label> Email</label>
              <input 
                className='form-control' 
                type="text" 
                name='email'
                value = {email}
                placeholder='Email'
                onChange={(e)=> onChange(e)} 
              /> 
            </div>
            <div className='form-group'>
              <label> Password </label>
              <input 
                className='form-control' 
                type="password" 
                name='password'
                value = {password}
                placeholder='Password'
                onChange={(e)=> onChange(e)} 
              />
            </div>
            <div className='form-group'>
              <label> Re-type Password </label>
              <input 
                className='form-control' 
                type="password" 
                name='password2'
                value = {password2}
                placeholder='Repeat Password'
                onChange={(e)=> onChange(e)} 
              />
            </div> 
            <div className='form-group mt-2'>
              <input className="btn form btn-success" value="Register" type='submit' name="Register" />
            </div>
        </form>
      </div>
      </Fragment>
  );
}

export default Register;
